import UpdateIssues from './components/UpdateIssues';
import ViewIssueById from './components/ViewIssueById';

function App() {
  return (
    <div>
      <Router>

                <div className="container">
                    <Switch> 
                          <Route path = "/issues/allissue" component = {ListAllIssues}></Route>
                          {/* <Route path = "/issues/updateissue" component = {UpdateIssues}></Route> 
                          <Route path = "/issues/:issueId" component = {ViewIssueById}></Route> */}
                    </Switch>
                </div>

        </Router>


    </div>
  );
}

export default App;
